PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE users (
	id INTEGER NOT NULL, 
	email VARCHAR(250) NOT NULL, 
	name VARCHAR(250) NOT NULL, 
	hashed_password VARCHAR(32) NOT NULL, 
	currency VARCHAR(5) NOT NULL, 
	created DATETIME NOT NULL, 
	updated DATETIME NOT NULL, is_active BOOLEAN, 
	PRIMARY KEY (id)
);
CREATE TABLE rates (
	date DATE NOT NULL, 
	currency VARCHAR(5) NOT NULL, 
	target VARCHAR(5) NOT NULL, 
	nominal INTEGER NOT NULL, 
	value NUMERIC(10, 4) NOT NULL, 
	PRIMARY KEY (date, currency, target)
);
CREATE TABLE categories (
	id INTEGER NOT NULL, 
	owner_id INTEGER, 
	created DATETIME NOT NULL, 
	updated DATETIME NOT NULL, 
	parent_id INTEGER, 
	name VARCHAR(250) NOT NULL, 
	bg VARCHAR(16), 
	PRIMARY KEY (id), 
	FOREIGN KEY(owner_id) REFERENCES users (id), 
	FOREIGN KEY(parent_id) REFERENCES categories (id)
);
CREATE TABLE accounts (
	id INTEGER NOT NULL, 
	group_id INTEGER NOT NULL, 
	created DATETIME NOT NULL, 
	updated DATETIME NOT NULL, 
	name VARCHAR(250), 
	currency VARCHAR(5) NOT NULL, 
	start_balance NUMERIC(10, 2) NOT NULL, 
	deleted BOOLEAN NOT NULL, 
	"order" INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(group_id) REFERENCES account_groups (id), 
	CHECK (deleted IN (0, 1))
);
CREATE TABLE IF NOT EXISTS "acl" (
	group_id INTEGER NOT NULL, 
	user_id INTEGER NOT NULL, 
	created DATETIME NOT NULL, 
	updated DATETIME NOT NULL, 
	is_readonly BOOLEAN NOT NULL, 
	is_admin BOOLEAN NOT NULL, 
	name VARCHAR(250), 
	visible BOOLEAN NOT NULL, 
	inbalance BOOLEAN NOT NULL, 
	deleted BOOLEAN NOT NULL, 
	"order" INTEGER NOT NULL, 
	PRIMARY KEY (group_id, user_id), 
	FOREIGN KEY(group_id) REFERENCES account_groups (id), 
	FOREIGN KEY(user_id) REFERENCES users (id), 
	CHECK (is_readonly IN (0, 1)), 
	CHECK (is_admin IN (0, 1)), 
	CHECK (visible IN (0, 1)), 
	CHECK (inbalance IN (0, 1)), 
	CHECK (deleted IN (0, 1))
);
CREATE TABLE IF NOT EXISTS "account_groups" (
        id INTEGER NOT NULL, 
        owner_id INTEGER NOT NULL, 
        created DATETIME NOT NULL, 
        updated DATETIME NOT NULL, 
        name VARCHAR(255) NOT NULL, 
        deleted BOOLEAN NOT NULL, 
        PRIMARY KEY (id), 
        FOREIGN KEY(owner_id) REFERENCES users (id), 
        CHECK (deleted IN (0, 1))
);
CREATE TABLE IF NOT EXISTS "transactions" (
        id INTEGER NOT NULL, 
        owner_id INTEGER NOT NULL, 
        created DATETIME NOT NULL, 
        updated DATETIME NOT NULL, 
        opdate DATETIME NOT NULL, 
        account_id INTEGER, 
        debit NUMERIC(10, 2) NOT NULL, 
        recipient_id INTEGER, 
        credit NUMERIC(10, 2) NOT NULL, 
        category_id INTEGER, 
        currency VARCHAR(5), 
        party VARCHAR(255), 
        details VARCHAR(1024), 
        PRIMARY KEY (id), 
        FOREIGN KEY(owner_id) REFERENCES users (id), 
        FOREIGN KEY(account_id) REFERENCES accounts (id), 
        FOREIGN KEY(recipient_id) REFERENCES accounts (id), 
        FOREIGN KEY(category_id) REFERENCES categories (id)
);
CREATE TABLE rules (
        id INTEGER NOT NULL, 
        owner_id INTEGER NOT NULL, 
        created DATETIME NOT NULL, 
        updated DATETIME NOT NULL,
        transaction_type INTEGER NOT NULL,
        condition_type INTEGER NOT NULL, 
        condition_value VARCHAR(255) NOT NULL, 
        category_id INTEGER, 
        party_id INTEGER, 
        PRIMARY KEY (id), 
        FOREIGN KEY(owner_id) REFERENCES users (id),
        FOREIGN KEY(category_id) REFERENCES categories (id),
        FOREIGN KEY(party_id) REFERENCES accounts (id), 
        CHECK (transaction_type IN (0, 1, 2))
);
COMMIT;
